    def con_muertes_probables
      muertes.map.each_with_index do |(de_informe, fecha, spec), idx|
        probables_fecha = muertes_probables[idx][1]
        raise "#{probables_fecha} no es igual a #{muertes_probables[idx][1]}" if fecha != probables_fecha
        [de_informe, fecha, spec.merge(muertes_probables[idx].last)]
      end
    end

    def con_muestras
      positivas.map.each_with_index do |(de_informe, fecha, spec), idx|
        muestras_fecha = muestras[idx][1]
        raise "#{muestras_fecha} no es igual a #{positivas[idx][1]}" if fecha != muestras_fecha
        [de_informe, fecha, muestras[idx].last.merge(positivas_pcr: spec.fetch(:casos))]
      end
    end
    
    def para(tema, options={})
      self.send(tema).select do |criterio|
        month, day, year = criterio[1].split('/').map(&:to_i)

        ENV["YEAR"] == "ALL" || year == (options[:year] || (ENV["YEAR"] && ENV["YEAR"].to_i) || 2022)
      end
    end         
    
